import React from "react";
import { Navbar } from 'react-bootstrap'
import logo from '../../images/Raft1Logo.png'

function Nav(props) {
  console.log('nav props', props)
  return (

    <Navbar bg="primary" variant="dark">
      <img src = {logo}/>
      <Navbar.Brand href="/">Raft1 Scheduler</Navbar.Brand>
        {props.user ?
          (
            <Navbar.Text>
              Signed in as: {props.user}. <button onClick={props.logOut}>Log Out?</button>
            </Navbar.Text>
          )
          :
          <br/>
        }
    </Navbar>
  );
}

export default Nav;
